import { useEffect } from "react"
import { useNavigate } from "react-router-dom"

export function NotFound() {

  // Cập nhật title
  useEffect(() => {
    document.title = "404";
  },);

  const navigate = useNavigate()

  useEffect(() => {
    setTimeout(() => {
      navigate("/")
    }, 3000)
  },[navigate])

  return (
    <div>
      <h1>404 - Page Not Found</h1>
      <p>Bạn sẽ tựu</p>
    </div>
  )
}
